import React from "react";
import Button from "@mui/material/Button";

interface ButtonProps {
	name: string;
}

const NomalButton: React.FC<ButtonProps> = ({ name }) => {
	const content = (
		<div>
			<Button
				variant="contained"
				color="primary"
				onClick={() => alert("クリックされました")}
			>
				ボタン
			</Button>
		</div>
	);
	return <h1>Hello, {name}!</h1>;
};

export default App;
